import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import robots from './robots';

ReactDOM.render(
    <div>
    <Card />
    <Card />
    </div>
, document.getElementById('root'));
serviceWorker.unregister();
